        console.log("...",error)
      })
   },[])


    return(
        <div>
        {video?.length>0 && video.map((each,index)=>{

            return(
                <div class="card" style={{width: "18rem"}}>

                <video src="https://codingyaar.com/wp-content/uploads/video-in-bootstrap-card.mp4"></video>
